// UnitLexerInit initializes any static state used to implement UnitLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewUnitLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func UnitLexerInit() {
	staticData := &unitlexerLexerStaticData
	staticData.once.Do(unitlexerLexerInit)
}

// NewUnitLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewUnitLexer(input antlr.CharStream) *UnitLexer {
	UnitLexerInit()
	l := new(UnitLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &unitlexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.predictionContextCache)
	l.channelNames = staticData.channelNames
	l.modeNames = staticData.modeNames
	l.RuleNames = staticData.ruleNames
	l.LiteralNames = staticData.literalNames
	l.SymbolicNames = staticData.symbolicNames
	l.GrammarFileName = "UnitLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

